const NewPost = () => {

    const [ myValue, setMyValue ] = useState('')
    return(

        <form>
            <input 
            type =  'text'
            value = {myValue}
            onChange = {((e) => setMyValue(e.target.value))}

            />
        </form>

    )
}

export default NewPost
